import React from 'react';

const Sidebar = () => {
    return (
        <aside>
            <h1>
                <h1>EVALUACION DE MODULO</h1>

                <div className="proyectos">
                    <h2>Tus Proyectos</h2>
                </div>
            </h1>
        </aside>
    );
};

export default Sidebar;
